import logo from '../../assets/logo.svg';
import styled from 'styled-components';

const LogoContainer = styled.div`
	display: flex;
	font-size: 30px;
`

function Logo() {
	return ( 
		<div className="logo">
			<img src={logo}
				   alt="logo"
					 className='logo-img'>
			</img>
				<p>
					<strong>Alura</strong>Books
				</p>
		</div>
	)
}

export default Logo;
